import {useEffect, useState} from "react";
import {FontAwesomeIcon} from "@fortawesome/react-fontawesome";
import { faUser, faHouseChimney } from "@fortawesome/free-solid-svg-icons";
import loginStyles from "./Login.module.css";

function Login () {

    return(
        <section id={loginStyles.login}>
            <div class="login__upper">
                <label>
                    <FontAwesomeIcon icon={faUser}/>
                </label>
                <input placeholder="Username"></input>
                <label></label>
                <input placeholder="****"></input>
            </div>
            <div class={loginStyles.login__buttons}>
                <div class={loginStyles.login__buttons__left}>
                    <button>회원 가입</button>
                    <button>ID/PW 찾기</button>
                </div>
                <div class={loginStyles.login__buttons__right}>
                    <button>Login</button>
                </div>

            </div>
        </section>
    );
}

export default Login;
